const WINDOW_SCREEN = {
  SM: 640,
  MD: 768,
  LG: 1024,
  XL: 1280
}
export {
  WINDOW_SCREEN
}
export const LAYOUTS = {
  DEFAULT: 'Default',
  PREMIUM: 'Premium'
}

export const TIME_PERIOD = [
  { id: '1', title: '1D' },
  { id: '2', title: '7D' },
  { id: '3', title: '1M' },
  { id: '4', title: '3M' },
  { id: '5', title: 'Last Years', children: [], active: true },
  { id: '6', title: '1Y' },
  { id: '7', title: 'YTD' },
  { id: '8', title: 'Custom', children: ['', ''] },
]
